    summary:
      'Easy To Make Spring Rolls might be just the hor d\'oeuvre you are searching for. This recipe makes 4 servings with <b>160 calories</b>, <b>12g of protein</b>, and <b>2g of fat</b> each. For <b>$3.61 per serving</b>, this recipe <b>covers 38%</b> of your daily requirements of vitamins and minerals. 22 people were impressed by this recipe. <b>Spring</b> will be even more special with this recipe. From preparation to the plate, this recipe takes roughly <b>45 minutes</b>. This recipe is typical of Vietnamese cuisine. A mixture of sugar, shrimp, chili pepper, and a handful of other ingredients are all it takes to make this recipe so yummy. It is a good option if you\'re following a <b>gluten free, dairy free, and pescatarian</b> diet. All things considered, we decided this recipe <b>deserves a spoonacular score of 98%</b>. This score is super. Try <a href="https://spoonacular.com/recipes/how-to-make-vietnamese-spring-rolls-794052">How To Make Vietnamese Spring Rolls</a>, <a href="https://spoonacular.com/recipes/how-to-make-vietnamese-spring-rolls-757109">How to make Vietnamese Spring Rolls</a>, and <a href="https://spoonacular.com/recipes/how-to-make-homemade-spring-rolls-with-peanut-sauce-512571">How to Make Homemade Spring Rolls with Peanut Sauce</a> for similar recipes.',
