    summary:
      'You can never have too many dessert recipes, so give Creamsicle Cookies a try. For <b>18 cents per serving</b>, this recipe <b>covers 2%</b> of your daily requirements of vitamins and minerals. This recipe makes 36 servings with <b>122 calories</b>, <b>2g of protein</b>, and <b>5g of fat</b> each. 13 people have made this recipe and would make it again. Head to the store and pick up sugar, baking soda, egg, and a few other things to make it today. From preparation to the plate, this recipe takes approximately <b>30 minutes</b>. All things considered, we decided this recipe <b>deserves a spoonacular score of 11%</b>. This score is not so amazing. Try <a href="https://spoonacular.com/recipes/orange-creamsicle-cookies-569014">Orange Creamsicle Cookies</a>, <a href="https://spoonacular.com/recipes/orange-creamsicle-cookies-517804">Orange Creamsicle Cookies</a>, and <a href="https://spoonacular.com/recipes/whole-wheat-creamsicle-muffins-with-creamsicle-glaze-65558">Whole Wheat Creamsicle Muffins With  Creamsicle Glaze</a> for similar recipes.',
