    instructions:
      "<ol><li>Preheat oven to 375 degrees.</li><li>In a small bowl, combine flour, baking soda, and salt; set aside.</li><li>In a large bowl, cream butter and sugars until light and creamy. Beat in egg and vanilla until smooth. Gradually add flour mixture until combined. Stir in orange zest and chips.</li><li>Drop rounded teaspoonfuls onto ungreased cookie sheets. Do not flatten cookies; it will make them dry. Bake 8 - 10 minutes or until golden brown around edges. Do not overcook! Cookies will be plump. Cool for several minutes on cookie sheets before transferring to rack to cool completely. Store in airtight container.</li></ol>",
