    summary:
      'If you want to add more <b>Mediterranean</b> recipes to your collection, Classic French Onion Soup might be a recipe you should try. For <b>$2.94 per serving</b>, you get a main course that serves 4. One portion of this dish contains approximately <b>18g of protein</b>, <b>24g of fat</b>, and a total of <b>416 calories</b>. 19 people were impressed by this recipe. If you have salt and pepper, parsley, flour, and a few other ingredients on hand, you can make it. It will be a hit at your <b>Autumn</b> event. It is brought to you by Foodista. From preparation to the plate, this recipe takes around <b>around 45 minutes</b>. Taking all factors into account, this recipe <b>earns a spoonacular score of 39%</b>, which is rather bad. If you like this recipe, you might also like recipes such as <a href="https://spoonacular.com/recipes/le-cafe-ile-st-louis-onion-soup-gratinee-this-is-a-new-take-on-the-classic-french-onion-soup-599269">Le Cafe Ile St. Louis Onion Soup Gratinee – this is a new take on the classic French Onion Soup</a>, <a href="https://spoonacular.com/recipes/classic-french-onion-soup-219941">Classic French Onion Soup</a>, and <a href="https://spoonacular.com/recipes/classic-french-onion-soup-706900">Classic French Onion Soup</a>.',
