    summary:
      '4 Ingredient Raw Peanut Butter Chocolate Cups might be just the condiment you are searching for. One serving contains <b>263 calories</b>, <b>9g of protein</b>, and <b>17g of fat</b>. This gluten free, fodmap friendly, and vegan recipe serves 12 and costs <b>67 cents per serving</b>. A few people made this recipe, and 41 would say it hit the spot. A mixture of dash of vanilla, chocolate, maple syrup, and a handful of other ingredients are all it takes to make this recipe so yummy. From preparation to the plate, this recipe takes around <b>45 minutes</b>. All things considered, we decided this recipe <b>deserves a spoonacular score of 54%</b>. This score is pretty good. Try <a href="https://spoonacular.com/recipes/microwave-peanut-butter-fudge-topped-with-chocolate-mini-peanut-butter-cups-muffins-for-muffin-538986">Microwave Peanut Butter Fudge topped with Chocolate & Mini Peanut Butter Cups | Muffins for Muffin</a>, <a href="https://spoonacular.com/recipes/death-by-peanut-butter-peanut-butter-cookies-with-chocolate-peanut-butter-cups-566305">Death by Peanut Butter: Peanut Butter Cookies with Chocolate Peanut Butter Cups</a>, and <a href="https://spoonacular.com/recipes/dark-chocolate-peanut-butter-stuffed-peanut-butter-cookie-cups-520177">Dark Chocolate Peanut Butter-Stuffed Peanut Butter Cookie Cups</a> for similar recipes.',
