    summary:
      'Snap Pean and Green Bean Salad with Arugula Pesto might be just the side dish you are searching for. For <b>$2.27 per serving</b>, this recipe <b>covers 23%</b> of your daily requirements of vitamins and minerals. One serving contains <b>441 calories</b>, <b>12g of protein</b>, and <b>36g of fat</b>. Head to the store and pick up roasted almonds, wax beans, lemon zest, and a few other things to make it today. Several people made this recipe, and 127 would say it hit the spot. From preparation to the plate, this recipe takes approximately <b>45 minutes</b>. It is a good option if you\'re following a <b>gluten free, primal, and vegetarian</b> diet. All things considered, we decided this recipe <b>deserves a spoonacular score of 96%</b>. This score is spectacular. Try <a href="https://spoonacular.com/recipes/snap-peas-and-green-beans-with-arugula-mint-pesto-716442">Snap Peas and Green Beans with Arugula-Mint Pesto</a>, <a href="https://spoonacular.com/recipes/snap-peas-and-green-beans-with-arugula-mint-pesto-875123">Snap Peas and Green Beans with Arugula-Mint Pesto</a>, and <a href="https://spoonacular.com/recipes/michael-natkins-potato-and-green-bean-salad-with-arugula-pesto-205312">Michael Natkin\'s Potato and Green Bean Salad with Arugula Pesto</a> for similar recipes.',
    cuisines: [],
    dishTypes: ["side dish"],
    diets: ["gluten free", "lacto ovo vegetarian", "primal"],
    occasions: [],
    instructions:
      "Bring a large pot of salted water to a boil.While your water is coming to a boil, prepare your arugula pesto and cilantro cream drizzle.In the bowl of your food processor, add the almonds, pistachios, garlic, lemon zest, baby arugula and basil leaves. Pulse 8-9 times until completely broken up. With the food processor running, slowly pour in the olive oil until the pesto just comes together. Season to taste with salt and black pepper and transfer to a large bowl.In the same food processor bowl (wipe clean if you wish), combine the yogurt and cilantro. Pulse until the two ingredients come together. Season to taste with salt and black pepper and set aside.Have an ice bath ready. Add the snap peas and beans to the boiling water and blanch for about 1 minute and 30 seconds. Drain and transfer immediately to the ice bath to cool down. Drain again once the veggies are cool, and pat them dry. Add the veggies to the bowl with the pesto and toss to coat.Pour the veggies onto a large platter and drizzle with the cilantro cream. Top with micro greens and sliced almonds. Enjoy immediately or place in the refrigerator to chill.",
