    instructions:
      "<ol><li>Pre heat oven to 350 degrees. Line 2 baking sheets with parchment paper and set aside.</li><li>With a mixer, beat butter and sugar together in a large bowl until well combined. Beat in yolks, lemon zest, lemon juice, and salt.</li><li>On low speed, beat in flour just until large moist clumps form. You may need to use your hands at this point to form one large ball.</li><li>Roll tablespoons of dough into balls. Place balls on prepared baking sheets about 1 inch apart. Make a deep indentation in center of each ball. Bake cookies until firm and lightly golden on bottom, about 18 to 20 minutes.</li><li>Remove cookies from oven and immediately fill indentations with curd.</li><li>Sprinkle with confectioners sugar before serving.</li></ol>",
